import { SignUpPage } from './'
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {  

  return (

      <Router>
        <GlobalStyle />
        <c.Navbar/>
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/sign-up' exact component={SignUpPage} />
        </Switch>
        <c.Footer />

      </Router> 

  );
}

export default App;
